import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Dashboard from './dashboard/Dashboard';

function App() {
    return (
        <Router>
            <div className="App">
                <Switch>
                    <Route path="/" exact component={Dashboard} />
                    {/* Add other routes here */}
                </Switch>
            </div>
        </Router>
    );
}

export default App;
